#include<conio.h>

int binsearchrec(int * a , int i , int j , int s){
    
    int inicio = i , fim = j;
    int meio ;

    if( inicio >= fim ) return -1;

    meio = ( inicio + fim ) / 2;
    
    printf("\ncomeco %4d meio %4d fim %4d achou %4d procura %4d",inicio,meio,fim,a[meio],s)   ;
    
    if(s==a[meio])
        return meio;

    if( s < a[meio] ){
        return binsearchrec( a, inicio , meio - 1 , s ); 
    }else{
        return binsearchrec( a, meio + 1, fim , s ); 
    }                     
}


int binsearch(int * a , int n , int s){
    
    int i = 0 , j = n -1;
    int m ;

    while(i<j){
        m = ( i + j ) / 2;
        
        if(s==a[m])return m;

        if( s < a[m] ){
            j=m; 
        }else{
            i=m;
        }                
    }

    if(s==a[i])return i;
        
    return -1;
}


void swap(int *a,int i,int j){
    int t = a[i];
    a[i] = a[j];
    a[j] = t;
}


int partition(int * a, int left, int right, int pivot){
    
    int pos, i;
    swap(a,pivot,right);
    pos=left;
    for(i=left;i<right;i++){
        if(a[i]<a[right]){
            swap(a,i,pos);
            pos++;  
        }   
    }
    swap(a,right,pos);
    return pos;
}

int quick(int * a,int left,int right){

/*    printf("\n");    
    for( int i = 0 ; i < 10;i++ ){
        printf("%d ",a[i]);
    }
*/
    if(left < right){
        int pivot = (left+right)/2;
        int pos = partition(a,left,right,pivot);
        return 1 + quick(a,left,pos-1) +  quick(a,pos+1,right);
    }
    return 0;
}


int bublesort(int * vet, int n)
{
    int i , j, aux,res=0;

    for(i=0;i<n-1;i++){
        for(j=i;j<n;j++){            
            if( *(vet+j) < *(vet+i) ){
                aux = *(vet+j);
                *(vet+j) = *(vet+i);
                *(vet+i) = aux;                
                res++;
            }            
        }
    }
    return res;
}   


